Do not add more details than necessary to the question.

chat history: 
{% for item in chat_history %} 
user: 
{{ item.inputs.chat_input }} 
assistant: 
{{ item.outputs.output }} 
{% endfor %}

Follow up Input: {{ chat_input }} 
